    >
      {/* <Progressbar count={0} /> */}
      <div className="wrapper">
        <DefaultLayout />
        <main className="container">
          <div className="content">
            <Home />
          </div>
        </main>
      </div>
    </ImagesLoaded>
  );
}

export default App;
